class Solution:
     def insert(self, intervals, newInterval):
         """
         :type intervals: List[Interval]
         :type newInterval: Interval
         :rtype: List[Interval]
         """
         if not intervals:
             return [newInterval]
         i = 0
         while i < len(intervals) and intervals[i].end < newInterval.start:
             i += 1
         if i == len(intervals):
             intervals.append(newInterval)
             return intervals
         intervals[i].start = min(intervals[i].start, newInterval.start)
         while i < len(intervals) - 1 and intervals[i].end >= intervals[i+1].start:
             i += 1
         intervals[i].end = max(intervals[i].end, newInterval.end)
         return intervals[:i+1] + intervals[i+2:]

