def find_match(code, files):
    code = re.sub(r'[\s]+', ' ', code)
    code = re.sub(r'^\s+|\s+$', '', code)
    max_match = 0
    matches = []
    for file, content in files:
        match = 0
        for line in content:
            line = re.sub(r'[\s]+', ' ', line)
            line = re.sub(r'^\s+|\s+$', '', line)
            if line == code[:len(line)]:
                match += 1
            else:
                if match > max_match:
                    max_match = match
                    matches = [file]
                elif match == max_match:
                    matches.append(file)
                match = 0
        if match > max_match:
            max_match = match
            matches = [file]
        elif match == max_match:
            matches.append(file)
    if max_match == 0:
        return '0'
    return '{} {}'.format(max_match, ' '.join(matches))

