 if n < r: 
  return 0
 elif r == 0 or r == n:
  return 1
 else:
  return ncr(n-1, r-1) + ncr(n-1, r)

def SieveOfEratosthenes(n): 
    prime = [True for i in range(n + 1)]
    p = 2
    while (p * p <= n): 
        if (prime[p] == True): 
            for i in range(p * p, n + 1, p): 
                prime[i] = False
        p += 1
    prime[0]= False
    prime[1]= False
    return prime

